  assemblies:
  - Booze Project
  namespace: Booze_Project
  summary: >-
    Application implementation for real (double) variable evaluation/assignment.

    Inherits parsing and evaluation behaviour from <xref href="Booze_Project.AppEvaluation" data-throw-if-not-resolved="false"></xref> and stores the evaluated value as a <xref href="System.Double" data-throw-if-not-resolved="false"></xref>.
  remarks: >-
    - During <xref href="Booze_Project.AppReal.Compile" data-throw-if-not-resolved="false"></xref>, the base class parses the parameter list and this instance is registered with the containing program variable table.

    - At runtime, <xref href="Booze_Project.AppReal.Execute" data-throw-if-not-resolved="false"></xref> evaluates the expression (via the program evaluator) and converts the result to <xref href="System.Double" data-throw-if-not-resolved="false"></xref>.

    - The class intentionally hides the integer <code>Value</code> from <xref href="Booze_Project.AppEvaluation" data-throw-if-not-resolved="false"></xref> with a <code>new</code> double-typed property to represent real values.
  example: []
  syntax:
    content: 'internal class AppReal : AppEvaluation, IAppCommand'
    content.vb: Friend Class AppReal Inherits AppEvaluation Implements IAppCommand
