  assemblies:
  - Booze Project
  namespace: Booze_Project
  summary: >-
    Runtime evaluation and assignment for a real variable.

    - Calls <xref href="Booze_Project.AppEvaluation.Execute" data-throw-if-not-resolved="false"></xref> to evaluate the expression into <xref href="Booze_Project.AppEvaluation.evaluatedexpression" data-throw-if-not-resolved="false"></xref>.

    - Attempts to parse the evaluated expression as a <xref href="System.Double" data-throw-if-not-resolved="false"></xref> and stores it in <xref href="Booze_Project.AppReal.Value" data-throw-if-not-resolved="false"></xref>.
  example: []
  syntax:
    content: public override void Execute()
    content.vb: Public Overrides Sub Execute()
  overridden: Booze_Project.AppEvaluation.Execute
  overload: Booze_Project.AppReal.Execute*
  exceptions:
  - type: BOOSE.StoredProgramException
    commentId: T:BOOSE.StoredProgramException
    description: Thrown when the evaluated expression cannot be parsed as a <xref href="System.Double" data-throw-if-not-resolved="false"></xref>.
